import React, {useState} from "react";
import "../styles/navbar.css";
import logo from "../resource/logo.png";
//import { Link } from 'react-router-dom';

const Navbar = () => {
    const [childOne, setChildOne] = useState({display: "block"});
    const [childTwo, setChildTwo] = useState({opacity: 1});
    const [childThree,setChildThree]=useState({display:"block"});
    const changeButton = () => {
        setChildTwo({opacity: 0})
    }
    return (
        <div className="navbar">
            <img src={logo}/>
            <div onClick={changeButton} className="menuButton">
                <div style={childOne}></div>
                <div style={childTwo}></div>
                <div style={childThree}></div>
            </div>
            <div className="menu">
                <nav>
                    <a href="#">HOME</a>
                    <a href="#">ABOUT</a>
                    <a href="#">TEAM</a>
                    <a href="#">SERVICES</a>
                    <a href="#">WORK</a>
                    <a href="#">CLIENTS</a>
                    <a href="#">CONTACT</a>
                </nav>
            </div>
        </div>
    )
}
export default Navbar
